window.bookSummaryJSON = "<p><b>A suicidal quest into the Umbral Depths.</b></p> <p>Major Voria stands ready to accept the cost for her actions at Marid. Stripped of command and resources, Voria must find a ship and rally a crew. Somewhere within the Umbral Depths lays a hidden world, a world that the dead god, Marid, intended her to find.</p> <p>Aran faces a choice. Halt his war mage training and, in the process, give up clues to his past, or abandon Voria. Aran sacrifices everything to follow Voria on a suicidal quest into the one place where even gods fear to tread.</p> <p>On a bleak world in the deepest darkness lays an object of enormous power, one that could turn the tide of the war against Krox. But Voria isn't the only one seeking the weapon. The great Void Wyrm Khalahk has vowed to hunt Voria and will see her dead, even if it means following her into the Umbral Depths themselves.</p> <p>All while the dreadlord, Nebiat, makes herself at home on Shaya, binding the souls of its leaders.</p>"; 
